fn bench_dijkstra(c: &mut Criterion) {
    c.bench_function("dijkstra", |b| {
        b.iter(|| {
            let _ = run_dijkstra();
        })
    });
}

criterion_group!(benches, bench_dijkstra);
criterion_main!(benches);
